import './App.css';
import yo from './yo.png';
import Presentacion from './component/layout/Presentacion';
import Header from './component/layout/Header';



import HomePage from './pages/HomePage';
import ContactPage from './pages/ContactPage';


function App() {
  return (

    <div className="App">

      <Header />





      <Presentacion
        text='nicolas caliri'>
        <img src={yo} />

      </Presentacion>

    </div>
  );
}

export default App;
